"use strict";

var questions = function questions() {
  $('.questions-item__content').hide();
  $('.questions-item__header').click(function () {
    $(this).siblings('.questions-item__content').slideToggle(200);
    $(this).toggleClass('questions-item__header_opend');
  });
};

$('.tabs-nav__list li').click(function () {
  var tabName = $(this).attr('data-tab-name');
  $(this).addClass('tabs-nav__item_active').siblings().removeClass('tabs-nav__item_active');
  $(".tabs-content .".concat(tabName)).addClass('tabs-content__item_active').siblings().removeClass('tabs-content__item_active');
});
var reviewsSlider = new Swiper('.reviews-slider__container', {
  navigation: {
    nextEl: '.reviews-button-next',
    prevEl: '.reviews-button-prev'
  }
});
var aboutSlider = new Swiper('.about-info__slider', {
  pagination: {
    el: '.swiper-pagination',
    type: 'fraction',
    renderBullet: function renderBullet(index, className) {
      return "<span class=\"".concat(className, "\">") + "0".concat(index + 1, "</span>");
    }
  },
  navigation: {
    nextEl: '.swiper-button-next',
    prevEl: '.swiper-button-prev'
  }
});

var sandwichMenu = function sandwichMenu() {
  if ($(window).width() <= '640') {
    $('.main-nav__list').hide();
    $('.sandwich__open-btn').click(function () {
      $('.sandwich').toggleClass('sandwich_opend');
      $('.sandwich').siblings('.main-nav__list').slideToggle(200);
    });
  }
};

jQuery(document).ready(function($) {

  $(".ajax-contact-form").submit(function() {
  var str = $(this).serialize();
  
  $.ajax({
  type: "POST",
  url: "http://domain.name/contact.php",
  data: str,
  success: function(msg) {
  if(msg == 'OK') {
  result = '<p>Ваш заказ принят</p>';
  $(".fields").hide();
  } else {
  result = msg;
  }
  $('.note').html(result);
  }
  });
  return false;
  });
});

questions();
sandwichMenu();
